import ReactDOM from 'react-dom/client';


function Car(){
return <h1>Hello world</h1>
}

function Garage(){
return (
    <>
<h2>Who lives in a Garage</h2>
< Car/>
</>
)
}

const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(<Garage/>);
